import{_ as e,c as t,o as a,a5 as r}from"./chunks/framework.B_t2O50T.js";const w=JSON.parse('{"title":"业界要文","description":"","frontmatter":{"title":"业界要文","date":"2019-07-17T17:03:42.000Z","tags":["业界","要文"]},"headers":[],"relativePath":"posts/key-articles.md","filePath":"posts/key-articles.md"}'),s={name:"posts/key-articles.md"},n=r('<h2 id="王小川的互联网江湖-从输入法到ai背后的故事" tabindex="-1">王小川的互联网江湖：从输入法到AI背后的故事 <a class="header-anchor" href="#王小川的互联网江湖-从输入法到ai背后的故事" aria-label="Permalink to &quot;王小川的互联网江湖：从输入法到AI背后的故事&quot;">​</a></h2><p>“我是1978年生的人，到今年是40岁，也是改革开放的同龄人。挺感谢这样一个大的时代背景，让自己成为了互联网飞速发展的见证者、参与者，也是受益者。”</p><p>具体请看<a href="http://news.gmw.cn/xinxi/2019-05/24/content_32864391.htm" target="_blank" rel="noreferrer">http://news.gmw.cn/xinxi/2019-05/24/content_32864391.htm</a></p><h2 id="搜狗王小川-翻译主场景不是翻译机-而是输入法与搜索" tabindex="-1">搜狗王小川：翻译主场景不是翻译机，而是输入法与搜索 <a class="header-anchor" href="#搜狗王小川-翻译主场景不是翻译机-而是输入法与搜索" aria-label="Permalink to &quot;搜狗王小川：翻译主场景不是翻译机，而是输入法与搜索&quot;">​</a></h2><p>从来没指望翻译机为搜狗提供支柱性收入来源，更大意义在于更多地从语言交互上实现AI落地扩展。</p><p>具体请看<a href="https://www.yicai.com/news/100096100.html" target="_blank" rel="noreferrer">https://www.yicai.com/news/100096100.html</a></p><h2 id="搜狗劫持百度神马等流量构成不正当竞争-3000万罚款创海淀法院同类案件最高纪录" tabindex="-1">搜狗劫持百度神马等流量构成不正当竞争，3000万罚款创海淀法院同类案件最高纪录 <a class="header-anchor" href="#搜狗劫持百度神马等流量构成不正当竞争-3000万罚款创海淀法院同类案件最高纪录" aria-label="Permalink to &quot;搜狗劫持百度神马等流量构成不正当竞争，3000万罚款创海淀法院同类案件最高纪录&quot;">​</a></h2><p>6月27日，海淀法院对奇虎公司、百度公司，以及动景公司和神马公司因搜狗输入法通过搜索候选词为搜狗搜索导流量分别起诉搜狗公司等不正当竞争纠纷三案集中宣判。法院一审认定搜狗公司构成不正当竞争，应停止不正当竞争行为，分别为三案原告公开消除影响，向奇虎公司、百度公司各赔偿经济损失500万元等，向动景公司和神马公司共赔偿2000余万元，系海淀法院同类案件罚款最高纪录。</p><p>具体请看<a href="https://www.yicai.com/news/100241684.html" target="_blank" rel="noreferrer">https://www.yicai.com/news/100241684.html</a></p>',9),o=[n];function i(c,h,l,p,_,m){return a(),t("div",null,o)}const f=e(s,[["render",i]]);export{w as __pageData,f as default};
